UPDATE page_text SET text='But Oh Sara if the dead can come back to Azeroth and flit unseen around those they love, I shall always be near you in the gladdest day and in the darkest night amidst your happiest scenes and gloomiest hours always, always and if there be a soft breeze upon your cheeks it shall be my breath, as the cool air fans your throbbing temple, it shall be my spirit passing by.$B$BSara, do not mourn me dead, think I am gone and wait for thee, for we shall meet again.$B$B--Sully' WHERE entry='332';
UPDATE page_text SET next_page='332' WHERE entry='323';
UPDATE `page_text` SET `text`='Rising from the ocean, a tower of water, Neptulon sent the great Krakken to doomed I\'lalai. So huge were their forms that jungles of kelp swayed through their limbs, and leviathans swam through bodies.$B$BThe largest Krakken then raised his arms high and crashed them into the sea, sending waves about him. And they raged toward I\'lalai.' WHERE (`entry`='324');
Update page_text SET next_page='325' WHERE entry='324';
UPDATE `page_text` SET `text`='The Krakken roared, and their voices thundered like an ocean storm:$B$B"We come."$B$BMin\'loth, standing firm, called forth his magic. The waves sent to I\'lalia parted and washed to both sides, and they flooded the jungle beyond. Min\'loth then bade his minions chant spells of binding, and a din rang out as dozens of troll voices rose.$B$BAnd one voice rose above the rest.' WHERE (`entry`='325');
Update page_text SET next_page='326' WHERE entry='325';
UPDATE `page_text` SET `text`='Min\'loth bellowed and his magic gathered the power of his minion\'s spells, and he cast it at the approaching Krakken.$B$BThe seas parted and Min\'loth\'s spell sped toward the servants of Neptulon. Lightning tore the sky and the spell struck them, and a thousand bolts fell, boiling water and burning craters in the earth.$B$BMin\'loth cried in triumph, knowing his spell would fell the great beasts.' WHERE (`entry`='326');
Update page_text SET next_page='327' WHERE entry='326';
UPDATE `page_text` SET `text`='But the Krakken are old, very old. They remembered when the land was first born from the sea.$B$BThey remembered when the Old Ones ruled and when the Travelers came and cast them down. They remembered when magic was new.$B$BThey are old and they hold many secrets. And though Min\'loth\'s spell was strong, it, like the troll, was mortal.$B$BAnd so it failed.' WHERE (`entry`='327');
Update page_text SET next_page='328' WHERE entry='327';
UPDATE `page_text` SET `text`='If failed to bind the Krakken, but it enraged them. Not in aeons had a mortal caused them pain, and the troll\'s spell was painful.$B$BAnd so they shed the bindings of Minloth\'s spell, but then roared and stuck with fury.$B$BA rumble was heard as great waves rose from the deep and raced toward the land. When they reached I\'lalai they cast a shadow on the city.$B$BBut before they destroyed it the Krakken halted, poised.' WHERE (`entry`='328');
Update page_text SET next_page='329' WHERE entry='328';
UPDATE `page_text` SET `text`='The troll witchdoctors trembled and cried out to their master. Min\'loth gazed at the mountains of the sea, doomed and defiant. He turned to his adepts and whispered, and the trolls etched his last words into stone.  Min\'loth then faced the looming Krakken.$B$BHe grimaced and hurled his staff, his last bold act.$B$BThe Krakken then bent their fury upon Min\'loth, and an ocean fell upon I\'lalai.$B$BAnd it was no more.' WHERE (`entry`='329');
Update page_text SET next_page='330' WHERE entry='329';
UPDATE `page_text` SET `text`='And then the waters fell upon the jungle, washing clean all they met. Trolls and beasts cried out as the waters smashed and drowned them.$B$BMany Gurubashi wondered why the ocean swallowed them, but then they died and knew nothing.$B$BAnd finally, when the waters reached the mountains, they stopped. Appeased, they retreated back beyond the shores, and they left a wake of death.$B$BThey retreated, but they surged around I\'lalai and remained, drowning it forever.' WHERE (`entry`='330');
Update page_text SET next_page='331' WHERE entry='330';
UPDATE `page_text` SET `text`='And the chief Var\'gazul, safe behind the mountains in Zul\'Gurub, went out to the jungle and found it washed clean of his people.$B$BAnd he despaired, for his dreams of conquest were thwarted.$B$BAnd never was Min\'loth the Serpent found.' WHERE (`entry`='331');
Update page_text SET next_page='0' WHERE entry='331';
