UPDATE `npc_text` SET `text0_1`='Welcome aboard $c.  Take a load off and enjoy the trip.  Aboard \"The Purple Princess\" we want you to relax.  We have vending machines down below if there\'s anything you might need while aboard.' WHERE `ID`=12327;
