UPDATE `npc_text` SET `text0_0`='Zul\'jin shall return one day, $r. Mark my words. Until then, we all hold our positions and do what we can to keep the forest troll population intact.$B$BWith that said, as master huntsman of Revantusk Village, it is my responsibility to insure that the world around us is safe for habitation.$B$BThe beasts of this area must be kept in check.$B$BAre you looking for work?$B' WHERE `ID`=7242;
UPDATE `npc_text` SET `em0_0`=0,`em0_1`=66,`em0_2`=0,`em0_3`=1,`em0_5`=1 WHERE `ID`=7334;
UPDATE `npc_text` SET `text0_0`='Very well then...$B$BYou have been tasked by your liege to guard his fields of corn from poachers and thieves.  One night on patrol, you stumble across a haggard man in thread-bare clothing stealing corn from the field.  You quickly confront him, and he immediately begs for his life.  He claims he is stealing the corn to feed his family since the lord of the land - your liege - demands too much in taxes.  Your liege is indeed known for his harsh taxes throughout the land.$B$BMake your choice.$B' WHERE `ID`=7340;
UPDATE `npc_text` SET `text0_0`='Your next choice awaits.$B$BYou are the sworn executioner for your liege.  A man has been sent to you for execution as a traitor of the liege and your people.  You know this individual as a close, virtuous friend who mysteriously vanished one day.  You also know that the man\'s crimes for which he was convicted supposedly caused the deaths of many innocent civilians.  Upon seeing you he begs for his life, claiming he was framed by a higher authority.$B$BMake your choice.$B$B' WHERE `ID`=7341;
UPDATE `npc_text` SET `text0_0`='Here is your fortune, $N.  May it serve you well.$B' WHERE `ID`=7365;
UPDATE `npc_text` SET `text0_0`='Hey Hey Hey!  I am here to promote a fabulous fishing tournament in Stranglethorn but you need to be tough enough to survive there and have enough skill in fishing to fish those waters.$B$BCome back later when you are more qualified!$B$B' WHERE `ID`=7676;
UPDATE `npc_text` SET `text0_0`='Greetings, $c - I\'m a Commendation Officer acting on behalf of the Darkspear tribe.  It is my duty to assist adventurers who have received Horde Commendation Signets.$B$BI accept signets in different quantities, but the most beneficial exchange for you is to hand in a set of ten at once.  I will enter your deeds into our records when you hand in your signets.  As a result, you will earn recognition from the Darkspear tribe for your duty and service.$B',`text0_1`='Greetings, $c - I\'m a Commendation Officer acting on behalf of the Darkspear tribe.  It is my duty to assist adventurers who have received Horde Commendation Signets.$B$BI accept signets in different quantities, but the most beneficial exchange for you is to hand in a set of ten at once.  I will enter your deeds into our records when you hand in your signets.  As a result, you will earn recognition from the Darkspear tribe for your duty and service.$B' WHERE `ID`=8127;
