UPDATE `npc_text` SET `text0_0`='Once our warchief heard that the Dark Portal had been reopened, he immediately gathered his advisors to plan this daring expedition. Though a few of his councilors have their doubts, Thrall holds out the hope that we might discover new insights into the history of our people. He believes that somewhere amidst the wreckage of this world, the true tale of the orcish people lies hidden.$B$BI must admit that in my darkest moments... I fear that that tale should remain untold.',`text0_1`='',`prob0`='1.0' WHERE `ID`=10003;
UPDATE `npc_text` SET `text0_0`='The Horde has risked much to venture into Outland - resources, manpower - even the tactical defense of our lands is at stake. Despite all else, Thrall believes in the promise of this ravaged land. There is a strange light in his eyes these days - as if he senses some stirring revelation the rest of us do not.$B$BStill, he is my warchief and my blood-brother. I would follow him through the gates of the abyss itself.',`text0_1`='',`prob0`='1.0' WHERE `ID`=10004;
