UPDATE `npc_text` SET `text0_0`='I cannot believe they made me move my transporter out of town!   Most of the gnomes affected by the accident regained some sort of humanoid form within a few weeks and it should have been an honor to be a participant in such a grand gnomish experiment!$B$BBesides, we needed the eggs!$B' WHERE `ID`=10363;
