UPDATE `npc_text` SET `text0_0`='The dead rise and seek vengeance on any that dare pass through their domain. Turn back!$B' WHERE `ID`=12221;
UPDATE `npc_text` SET `text0_0`='Through the valleys and peaks of Mount Hyjal, across the shifting sands of Silithus, against the Legion\'s dread armies - we have fought. We are the nameless, faceless, sons and daughters of the Alliance. By the Light and by the might of the Alliance, the first strike belongs to us and the last strike is all that our enemies see.$B$BWe are 7th Legion.$B' WHERE `ID`=12739;
UPDATE `npc_text` SET `text0_1`='We are quickly learning the price of death in this frigid wasteland, $N. The Lich King\'s power extends across every inch of Northrend, permeating into the earth itself! He turns our own fallen people against us.$B$BFrom the sky, risen gryphon riders rain down their vengeful stormhammers as the walking dead assail us on the ground.$B' WHERE `ID`=12823;
UPDATE `npc_text` SET `text0_0`='Look around and let the devastation sink in, $c. Every last troll that lived here is either dead or has fled to the upper levels.$B$BIt gets worse.$B$BIn an act of desperation, the living Drakkari trolls sacrificed their own animal gods so that they could drink from the blood of the gods and gain untold power. While they succeeded in keeping the Scourge at bay with their newfound strength, the results were catastrophic. The ancient empire of Zul\'Drak lies in ruin as proof.$B' WHERE `ID`=13615;
