UPDATE `quest_template` SET `Details`='These signs do not bode well for us, $N.  I\'ve never been one for secrecy so I will tell you a bit about my organization, the Violet Eye.$B$BWe are agents of the Kirin Tor, the Magus Senate of Dalaran.  We were assigned to keep an eye on Karazhan and Medivh, in case things got out of hand.$B$BWhich they did... very quickly, after Medivh disappeared.$B$BThis report details my findings.  Take it to Archmage Cedric, also from the Violet Eye; you will find him in the outskirts of Dalaran Crater.',`Objectives`='Bring Alturus\'s Report to Archmage Cedric in the outskirts of Dalaran Crater.' WHERE `entry`=9826;
