UPDATE `quest_template` SET `Details`='Now that Swamprat Post is complete, our control of the roads in and out of the marsh is much less tenuous. Our presence in Terokkar Forest is much less secure. Even so, at Stonebreaker Hold, Rakoria awaits word of our progress.$B$BShe\'s sharp and capable, $N, but be careful around her. She\'s got a lot of goods she\'s eager to move along the roads, but don\'t assume she\'s got our best interests at heart. Rakoria goes where she believes there\'s profit to be found.' WHERE `entry`=10105;
UPDATE `quest_template` SET `Details`='I fear that these dwarves do not understand what they have built upon. This area was once the ancestral grounds for the Shadowmoon orcs. I speak of spirits, $r.$B$BFor nearly twenty years they have laid dormant beneath the Wildhammer Stronghold, but recently, something has riled them up.$B$BVenture beyond the gates of Wildhammer and seek out the pools and rivers of fel lava found across this land. Near the lava will be ever-burning ash. Bring me this ash so that I may craft something that will help us.' WHERE `entry`=10642;
UPDATE `quest_template` SET `Details`='There is one more gronn to be slain: Skulloc Soulgrinder. He keeps himself hidden away, but there is a way to coax him forth.$B$BHe was trained by an ogre warlock known as Vim\'gol the Vile, whose grimoire you must retrieve!$B$BVim\'gol must be summoned by standing within a fire ring at his circle. Find Vim\'gol\'s Circle in the mountains, to the northeast, near the Broken Wilds.$B$B$N, if you hear Vim\'gol talk about growing bigger, get people back into each of the five fire rings to interrupt his casting!' WHERE `entry`=10998;
UPDATE `quest_template` SET `Details`='Oluf will come out if you defeat the other gladiators. That\'s \'bout the only way we\'re getting\' that cipher back. Put on your whompin\' boots and get busy in the Ring of Judgement. If you do manage to get the cipher back, return it to Glorenfeld o\'er near the entrance to these catacombs.$B$BMe? Don\'t worry about me! We\'re on the brink of discovering the missing link to human-kind!',`Objectives`='Defeat the gladiators at the Ring of Judgement and face Oluf the Violent. Defeat Oluf and recover the Ancient Cipher.$B$BReturn the Ancient Cipher to Glorenfeld at the entrance to the Utgarde Catacombs.' WHERE `entry`=11300;
UPDATE `quest_template` SET `Details`='To the southwest was a glade that used to look much like this one. Mysterious forces and alien magics are reshaping the land. The glade has thawed, the sisters living there driven mad by the sudden change.$B$BWe thought to reach out to them, but they attacked us. I fear many may be beyond saving, but I cannot give up hope.$B$BTake my pendant, travel southwest to the Vibrant Glade, and use it to try to free my sisters.' WHERE `entry`=11314;
