UPDATE `quest_template` SET `Details`='North, south, east and west. Those are the locations that you should be concerned about. Surrounding this fortress, within Mightstone Quarry, are four perfectly situated Nerub\'ar sinkholes.$B$B<Holgoth hands you a bundle.>$B$BBe very careful with that package, $N. Mishandle it and you\'ll be dog meat.$B$BInside the bundle are seaforium depth charges. Get to each of those Nerub\'ar sinkholes and plant a depth charge at their center point. If all goes well, the tunnels will collapse.$B$BGet a move on!' WHERE `entry`=11608;
UPDATE `quest_template` SET `Details`='They call themselves the Kvaldir.  My people have legends about them; we call them the tuk-hariq - walkers of the fog.$B$BMy village was destroyed by these giant mist-men.  Everyone I knew was slain, including my father Ariut.$B$BBy tuskarr law I must seek retribution against those who shed my kin\'s blood.$B$BI am but a fisherman and I\'ve not yet passed the test of manhood... I cannot stand toe-to-toe with the vile Kvaldir.$B$BIf you were to carry out my blood duty for me, I will be in great debt to you.',`Objectives`='Karuk wants you to slay 6 Skadir Raiders and 5 Skadir Longboatsmen.' WHERE `entry`=11613;
UPDATE `quest_template` SET `Details`='I must find out what happened to my master, Farseer Grimwalker!$B$BEarlier, he was observing the magnataur at nearby Magmoth. But one of his grunts just returned, saying that the group had been crushed, and that the farseer was dragged into the depths of the place.$B$BBefore I send you on a suicide mission, I wish to consult with the spirits to learn more.$B$BThere is an air elemental known as Imperean in the ruins of Eldra\'nath to the west. She is wise and may give you the information we seek.' WHERE `entry`=11624;
