UPDATE `quest_template` SET `Details`='Powerful spirits watch over my tribe -- Kaskala will not be lost.$B$BIssliruk will give us courage, Tayutka will make sure our survivors always have food and shelter and Karkut will watch over the fallen so they do not lose their way.$B$BIssliruk\'s guidance is the one we need the most right now.  I asked my nephew, Iruk, to bring me Issliruk\'s totem, but the Kvaldir\'s spears struck him down and his body fell into the waters to the north.  Bring me the totem, $N.  Don\'t let my nephew\'s death be in vain.' WHERE `entry`=11961;
