UPDATE `quest_template` SET `Details`='I\'ve got it, mon!$b$bTo da north, on da Ziggurat at Zeb\'Halak be a stone head with ruby eyes. One o\' dem be da Eye of the Prophets! Bring it to the brazier there and drink my elixir.$b$bAgain, ya be needing some mojo for my elixir to work - dis time from da warlord, Zim\'bo. He be hidin\' in one of da huts in Zeb\'Halak.$b$bIt be a shame to kill Zim\'bo, mon, but he swore da blood oath to defend Drak\'Tharon and he done failed. Now at least his mojo be helpin\' us to reclaim Drak\'Tharon.' WHERE `entry`=12007;
UPDATE `quest_template` SET `Details`='Vor\'takh is right -- we cannot allow this opportunity to slip through our fingers.$B$BFortunately, I think I know of a way to translate the journal of this Brann.$B$BThe shamans of the Redfang furbolgs, who congregate at the Heart\'s Blood Shrine south of the camp, grow an herb known as spiritsbreath. An experienced mystic can use incense made from it to seek wisdom from the spirits of the ancestors.$B$BSeek out the shaman known as Grumbald One-Eye. He should carry the herb for his devotions to Ursoc.' WHERE `entry`=12054;
UPDATE `quest_template` SET `Objectives`='Bring the Emblazoned Battle Horn to Wyrmrest and seek out someone who might be interested in assessing the potential threat.' WHERE `entry`=12146;
UPDATE `quest_template` SET `Details`='There\'s no reason to suspect Dregmar\'s words are anything but true. Whether Grom\'thar defeats you or is defeated by you, he can wash his hands of this.$b$bFollow his instructions... take the horn that you brought me earlier, travel to the ring of torches south of the Azure Dragonshrine, and blow it to announce your challenge.$B$BWhen Grom\'thar the Thunderbringer arrives, kill him and bring me his head.' WHERE `entry`=12151;
UPDATE `quest_template` SET `RewItemId1`=37836,`RewItemCount1`=10 WHERE `entry`=12170;
UPDATE `quest_template` SET `Details`='If, as Prospector Varana said, only certain irons are permitted to communicate with this Loken, it\'ll probably be the overseers who have the privilege.$B$BWe have to get you in there to see what all this is about, but it won\'t be easy. The first step will be to get a proper uniform for you.$B$BThen, we\'ll worry about doing your makeup.$B$BFind one of the overseers at Dun Argol, kill him, and bring back his uniform. If you get blood on it, you\'ll have only yourself to blame.' WHERE `entry`=12183;
UPDATE `quest_template` SET `Details`='Well, we\'ve got the shell of a golem, but that\'s not good enough for Tormak. He doesn\'t realize that these things don\'t just come together and miraculously start working! We\'re going to need power cells to animate it.$B$BWhen I was in Dun Argol, I noticed that Rune-Smith Durar and Rune-Smith Kathorn were the ones who manufactured the cells. We\'ll need one from each to power our golem.$B$BYou should be able to find each rune-smith in his workshop on the central level of Dun Argol.' WHERE `entry`=12197;
UPDATE `quest_template` SET `Details`='It sounds like this Loken is the mastermind behind the sudden preparations for war on the part of the iron dwarves.$B$BOnly the highest ranking irons are likely to have access to him, so we\'ll have to make you into an overseer to find out what\'s going on in there.$B$BI have a plan, for that, but we\'ll need some supplies.$B$BFind one of the iron rune overseers at Dun Argol, to the southeast, kill him, and bring back his uniform. ' WHERE `entry`=12201;
UPDATE `quest_template` SET `Objectives`='Master Woodsman Anderhol at Amberpine Lodge wants you to kill Tallhorn Stag and collect 8 Succulent Venison.' WHERE `entry`=12212;
UPDATE `quest_template` SET `Details`='Lord Fordragon has led a crushing assault against Arthas at the Wrathgate. In response to this affront, Arthas has sent Naxxramas down upon us. While Kel\'Thuzad hides in the floating citadel, his ground commander, Thel\'zan, lays siege to Wintergarde Keep. The lower village is already lost and any chance of extracting survivors from the ruins diminishes by the minute.$B$BWe must act quickly! Report to Gryphon Commander Urik at the gryphon station at once! He\'ll get you up to speed.$B$BLeave me!' WHERE `entry`=12235;
UPDATE `quest_template` SET `Details`='Enough! I want you to put an end to the torture of my people!$B$BThe Onslaught\'s torturer, LeCraft, has been bleeding information out of everyone that gets caught by those fiends! I need to know what they know.$B$BMy sources tell me that he has set up shop in the basement of their barracks, which is right next to the smithy.$B$BI\'ll loan you my personal branding iron to see to it that the job is done right.$B$BFind him and get that information.' WHERE `entry`=12252;
UPDATE `quest_template` SET `SuggestedPlayers`=3 WHERE `entry`=12315;
UPDATE `quest_template` SET `Details`='I have another task that needs attention. I have brothers who are falling in the battle overhead and if we do not act quickly, they will only bolster the emberwyrm ranks.$B$BGet into the shrine through one of the other passes to the south or north... the Scourge presence should be lighter there.$B$BSearch the shrine for ruby acorns that have fallen from the tree and plant them near the bodies of my fallen brood. Through this, they can give new life... a proud fate for any of my kind.' WHERE `entry`=12417;
UPDATE `quest_template` SET `ObjectiveText1`='Horde Lumberboat destroyed' WHERE `entry`=12437;
UPDATE `quest_template` SET `Details`='Posted by: Highlord Leoric Von Zeldig$B$BUpon the northeastern path from Wintergarde a battalion of 7th Legion were ambushed and slain by Onslaught Commander Iustus and an army of mindless Scarlet Onslaught zealots. Such cold and calculated actions must be met with force!$B$BWintergarde demands justice! Seek out Onslaught Commander Iustus at Onslaught Base Camp to the northeast and end his miserable existence.$B$BI will hand out the reward for this bounty to any who would dare take up the task!' WHERE `entry`=12442;
UPDATE `quest_template` SET `Details`='I have another task that needs attention. I have brothers who are falling in the battle overhead and if we do not act quickly, they will only bolster the emberwyrm ranks.$B$BGet into the shrine through the pass in the south... the Scourge presence should be lighter there.$B$BSearch the shrine for ruby acorns that have fallen from the tree and plant them near the bodies of my fallen brood. Through this, they can give new life... a proud fate for any of my kind.' WHERE `entry`=12449;
UPDATE `quest_template` SET `Details`='Ahh, good. They sent someone.$b$bListen, $r. We need a hand here. Our forces were pushed back and we\'ve lost Drak\'Sotra to the Scourge. Where they came from is anyone\'s guess....$b$bThe point is, we need every man we can get here, and some of our best have yet to return from battle.$b$bI need you to enter the ruins now that the fighting has died down and find our wounded, patch them up, and bring them here to me.$b$bScour Drak\'Sotra! They couldn\'t have gone far.' WHERE `entry`=12512;
