UPDATE `quest_template` SET `Details`='We were not quick enough, $N.  The cultist scum have arrived at the Glimmering Pillar and are making preparations to destroy it, I can sense them.$B$BWe don\'t have much time.  Blow upon this horn atop the Glimmering Pillar to channel my power through the crystal.$B$BWe shall show this scum to not trifle with the titans\' creations.' WHERE `entry`=12620;
UPDATE `quest_template` SET `Details`='Crafted of bone and dripping with blood, this choker is of intricate and deliberate design.$b$bGazing upon it overwhelms you with an ominous presence - one that compels you to wear it. You fight the urge, and resolve to bring it back to Ebon Watch.$b$bIf anyone can explain this, a death knight can....' WHERE `entry`=12633;
UPDATE `quest_template` SET `Details`='By now you\'ve probably guessed the details of my plan.$b$bWe\'re using the Scourge\'s interest in you against them. You\'re going undercover. I know it\'s likely a death sentence, but if we do nothing your death is a certainty.$b$bTravel northeast to Reliquary of Pain and stand on the platform while wearing your disguise. Once inside Voltarus, you must earn the trust of the Scourge commander.$b$bWhen you\'ve completed your mission, blow this horn and I\'ll fly to your location to receive your report.' WHERE `entry`=12661;
