UPDATE `quest_template` SET `Details`='$N, we need a key to unlock the chains of the rhino god, Akali. Even now he is being prepared for the slaughter.$B$BThe Drakkari warlord, Zol\'Maz, carries the key. Hearing of your exploits, he has secluded himself and his family at their stronghold up the steps to the northeast.$B$BThe warlord is strong and you will need help. If you were to combine the tiki, sword and incantation of his family members, you would be able to summon such help as you challenge him before his home\'s gate.' WHERE `entry`=12712;
