UPDATE `quest_template` SET `Details`='Now that you got your bone gryphon, I wantcha to take it back down there everyday and make a no fly zone over Onslaught Harbor.$B$BI gotta admit, mon, I don\'t really care if you use the bone gryphon to kill them gryphon riders or not. But I\'m guessin\' that if you do, you\'ll find it much easier to get to \'em.$B$BBesides, it\'s got lots of neat tricks you can use.' WHERE `entry`=12815;
