UPDATE `quest_template` SET `QuestFlags`=4224,`Details`='Hey there again! You didn\'t run off like all the other adventurers did? Well, you\'re just a peach, aren\'t ya? I was beginning to think I smelled funny or something!$B$BWe could still use a bit of a hand around here, and you have just the right experience.  Remember those magnataur? Well apparently the cave didn\'t completely collapse... there are still quite a few left. So much for Gino taking care of them, eh?$B$BFortunately, Jeer made way more than enough mines. You\'ve got this!' WHERE `entry`=12833;
UPDATE `quest_template` SET `EndText`='Weapon emblazoned' WHERE `entry`=12842;
UPDATE `quest_template` SET `Details`='You have to help us!  We were in the middle of an expedition into the mountains to set up a transmission tower when we were attacked.$B$BThey looked like vrykul, except their skin was blue and layered with frost.... and they were all female!  They took all the men in the expedition and let us women go.  Please, $N!  We think they\'re being held in Sifreldar, the village overlooking K3.' WHERE `entry`=12843;
UPDATE `quest_template` SET `ObjectiveText1`='Unworthy Initiate dominated' WHERE `entry`=12848;
UPDATE `quest_template` SET `Details`='Hey there, pal!$B$BDo you like excitement and explosions?! Who doesn\'t? I know just the place for you. Down at luxurious K3, they\'re always making innovative inventions and finding all-new ways to make things blow up! Sounds thrilling, doesn\'t it? If you want to be part of the fun, head on down today and speak to Jeer Sparksocket!$B$BMandatory disclaimer: manual labor may be required to partake in previously indicated \"excitement.\"' WHERE `entry`=12853;
UPDATE `quest_template` SET `Details`='The tone of Brann\'s note suggests he meant to bury something with the note, maybe a pack of some kind. You\'re sure this was all you found?$B$BOkay, I\'m going to have you take one of these frosthounds with you. The frostborn use them for tracking. Bring it to the destroyed camp and let it get Brann\'s scent.$B$BIt should at least lead you to the location of those missing possessions, and if we\'re lucky, Brann himself. ' WHERE `entry`=12855;
UPDATE `quest_template` SET `ObjectiveText1`='Rescued Brunnhildar Prisoners' WHERE `entry`=12856;
UPDATE `quest_template` SET `Details`='So...  so I don\'t think we\'re going to be getting a good foothold in those mountains.$B$BTrust me, I\'m not one to give up easily... but between freezing engines, nasty vrykul women, territorial dragon want-to-bes and the half a dozen other nasties settled in the area, this just ain\'t happening.$B$BDon\'t let that dissuade you though! Just because we can\'t get a foothold doesn\'t mean we won\'t get you there... one-way trips are pretty simple when you get down to it.$B$B<Ricket nods at some nearby rockets.>' WHERE `entry`=12862;
UPDATE `quest_template` SET `Details`='I be more than willing ta lend my shelter and home ta travelers in need, but I\'m nae too keen ta force my people inte yer affairs.$B$BI\'ll tell ye what... my people are warriors, straight and true. On the day a frostborn becomes a man, he has ta prove himself in battle. He has ta show us that he\'ll not let size hold\'m back.$B$BShow me yer as strong and fierce as one of my men, and I\'ll have them lend ye an ear or a blade. Speak ta Fjorlin over by the cliff to the south there and he\'ll put ye ta the test.',`Objectives`='Yorg Stormheart at Frosthold has requested that you speak to Fjorlin Frostbrow to secure a ride and face your challenge.' WHERE `entry`=12874;
UPDATE `quest_template` SET `Details`='Our scouts have spotted iron dwarves in the valley north of here. I overheard King Stormheart sending you to visit Drom and I\'m admittedly a bit worried about\'m.$B$BIf you find any iron dwarves when you head down there, put\'m down hard and fast for me, eh? I dun think they know exactly where we are or how to get here just yet, and I\'d prefer to keep it that way.',`Objectives`='Fjorlin Frostbrow at Frosthold wants you to kill 10 Stormforged Invaders.' WHERE `entry`=12876;
UPDATE `quest_template` SET `ReqItemId1`=41260,`ReqItemCount1`=1 WHERE `entry`=12879;
UPDATE `quest_template` SET `Details`='West of here, across the ruined roads and structures, is the death knight encampment of Ebon Watch.$B$B<Crusader Lord Lantinga rolls up Drakuru\'s orders.>$B$BTake these orders and deliver them to Stefan Vadu. He is the death knight in command at Ebon Watch. Let him know that the Argent Crusade will deal with Prince Navarius. They\'ll have to handle Drakuru.$B$BBe careful, $N. The way to Ebon Watch is teeming with Scourge.' WHERE `entry`=12884;
UPDATE `quest_template` SET `Details`='Before we left, I received the file Scout Vor\'takh compiled on this Brann Bronzebeard. There can be no doubt that Brann was headed for the Storm Peaks from his journal entries and findings in Grizzly Hills. Before we crashed, I caught sight of a campsite south of here, across the Foot Steppes, and overlooking the frozen Bor\'s Breath River.$B$BIf Brann isn\'t there, search the camp and its environs for any clues as to where that blasted dwarf might\'ve gone. Bring back anything you find.' WHERE `entry`=12895;
UPDATE `quest_template` SET `Objectives`='Mildred the Cruel at the Forlorn Mine wants you to use the Disciplining Rod on 6 Exhausted Vrykul.' WHERE `entry`=12906;
UPDATE `quest_template` SET `Details`='We\'ve seen the iron dwarves and their constructs making war on the creatures of stone that Brann calls the earthen, along with their giant allies. Contact him and aid him in any way you can, and remember that anything we can learn from his search may aid us in fighting against the iron dwarves and their master.' WHERE `entry`=12926;
UPDATE `quest_template` SET `Details`='The earthen who once inhabited, built, and maintained Ulduar were ousted from their home when Loken took over the city. Since then, his iron dwarf followers have relentlessly attacked the exiles.$B$BThey have taken refuge in an old titan building, which they now call Bouldercrag\'s Refuge, on the face of a mountain west of the Inventor\'s Library. Bouldercrag and his brethren fight to keep the irons from overrunning their haven, but they cannot hold their ground long. Find and help them, $N.' WHERE `entry`=12929;
UPDATE `quest_template` SET `QuestFlags`=128,`Objectives`='Use the Earthen Mining Pick to mine 7 clumps of Enchanted Earth. Bring the earth and 5 Frostweave Cloth to Bouldercrag the Rockshaper at Bouldercrag\'s Refuge.' WHERE `entry`=12930;
UPDATE `quest_template` SET `Details`='Traitors.  We Hyldnir have little love for them.$B$BThe dwellers of Valkyrion have gone unpunished for far too long.  While we remained loyal to Thorim, they became the Lich King\'s lapdogs!$B$BThey call the ones who receive his gift val\'kyr.  They fly on feathered wings, like the harpies they are.$B$BYou will find Valkyrion far to the northwest, beyond the Temple of Storms.  Slay these winged she-wolves, sister.  Slay them and I will reward you with one of my most prized possessions.',`Objectives`='Iva the Vengeful in Brunnhildar Village wants you to go to Valkyrion and slay 12 Nascent Val\'kyr.' WHERE `entry`=12942;
UPDATE `quest_template` SET `Objectives`='Combine an Iron Dwarf Brooch, a Huge Citrine and a Sun Crystal to create a Wicked Sun Brooch and bring it to Timothy Jones in Dalaran.$B$BYou can find an Iron Dwarf Brooch on any Northrend Iron Dwarf.' WHERE `entry`=12960;
UPDATE `quest_template` SET `Details`='Pfft, what happens down here ain\'t fightin\'. It\'s a couple of guys dancin\' around a flag.$B$BYou lookin\' for some real action, buddy? \'Cause if you are I got the hottest ticket in town.$B$BEver heard of Gurgthock and Wodin? Goblin and troll who ran the Ring of Blood back in Outland? Well they\'re here in Northrend and they\'ve started up a whole new fight club over in Zul\'Drak. If you\'re interested go to Zul\'Drak, east of Crystalsong. They\'re at the big arena in the center. Tell \'em Shifty sent ya!' WHERE `entry`=12974;
UPDATE `quest_template` SET `ObjectiveText1`='Niffelem Forefather freed',`ObjectiveText2`='Restless Frostborn freed' WHERE `entry`=12977;
UPDATE `quest_template` SET `Details`='Greetings, $r.$b$bI have a task that King Jokkum felt you would be suited for, assuming you still strive to gain favor with our people.$b$bI have developed plans for another artifact, one that will grant Hodir\'s blessing of protection to our stronghold. I have nearly all that I require for its construction. All that remains to collect are the very eyes of our fallen enemies.$b$bTake this tool, and gather the eyes from the iron giant corpses that litter our fields.' WHERE `entry`=12985;
UPDATE `quest_template` SET `Objectives`='Creteus in the Foot Steppes has requested that you travel to the Temple of Invention, the Temple of Winter, the Temple of Life, and the Temple of Order and utilize the databank to examine each area.' WHERE `entry`=12986;
UPDATE `quest_template` SET `Details`='The vile jormungar have taken over most of the Hibernal Cavern.  They are despicable beings... children of Loken, Thorim\'s scumsucker of a brother.$B$BAs Thorim\'s servants we owe it to ourselves to kill these scum where we find them.  You\'ll find the cavern just east of here, outside the village.' WHERE `entry`=12989;
UPDATE `quest_template` SET `Details`='The attack on the Terrace of the Makers was not a half-hearted move on my brother\'s behalf.  He sent a legion of iron dwarves and some of his most powerful lieutenants.$B$BUse the Horn of the Peaks to call the earthen to your side and defeat Loken\'s servants.$B$BYou\'ll find the giant, Eisenfaust, inside the Hall of the Shaper to the north.  You\'ll find the others deeper inside the Terrace of the Makers, beyond the stairs to the northwest.',`Objectives`='Thorim wants you to slay Eisenfaust inside the Hall of the Shaper and Halefnir the Windborn and Duronn the Runeforged in the Terrace of the Makers.' WHERE `entry`=13035;
UPDATE `quest_template` SET `Details`='When the bronze dragonflight gifted me with immortality and set me on the path of the witness, Nozdormu entrusted me with the Lorehammer.$B$BThe hammer\'s reaction to your findings means that time has gone awry here and it is our duty to restore the true timeline.$B$BWe must find it. To the northwest is Frostfloe Deep, ancient burial cave of the warriors of Tunka\'lo. Seek out the spirit of Chieftain Swiftspear, Stormhoof\'s brother. Ask him what he remembers of his brother\'s battle against the North Wind.' WHERE `entry`=13037;
UPDATE `quest_template` SET `Objectives`='The Bone Witch in Njorndar Village has asked you to beat information out of Apprentice Osterkilgr concerning what Dr. Terrible is truly up to.$B$BYou are then to slay the apprentice.' WHERE `entry`=13042;
UPDATE `quest_template` SET `Objectives`='Meet Thorim near the Temple of Wisdom.  Report the outcome of the fight to King Jokkum in Dun Niffelem.' WHERE `entry`=13047;
UPDATE `quest_template` SET `Objectives`='Tracker Val\'zij wants you to slay Gimorak inside Gimorak\'s Den.' WHERE `entry`=13056;
UPDATE `quest_template` SET `Details`='So...  so I don\'t think we\'re going to be getting a good foothold in those mountains.$B$BTrust me, I\'m not one to give up easily... but between freezing engines, nasty vrykul women, territorial dragon want-to-bes and the half a dozen other nasties settled in the area, this just ain\'t happening.$B$BDon\'t let that dissuade you though! Just because we can\'t get a foothold doesn\'t mean we won\'t get you there... one-way trips are pretty simple when you get down to it.$B$B<Ricket nods at some nearby rockets.>' WHERE `entry`=13060;
UPDATE `quest_template` SET `Details`='Perhaps you\'ve heard the praises for our missing hero?$B$BCrusader Bridenbrad was in the Broken Front aiding the attack against the Scourge when the undead army came down upon them. The many men of that allied force scattered, but Bridenbrad alone returned and dragged more than a dozen men to safety, one by one through the carnage.$B$B$C, he has not returned since. He was spotted heading to the far northeast, towards the Silent Vigil. Bring him back to me that I might honor him for his valor.' WHERE `entry`=13068;
UPDATE `quest_template` SET `Details`='I know why you\'ve come... they\'ve sent you to bring me back, but that cannot happen. I carry the plague of undeath, $c, and I\'ll not share my fate with those near me. No, I shall stay here.$B$BMy only regret lies in what I may become when death grips me. I do not fear death itself, but I loathe to consider serving the traitor, Arthas.$B$BLeave me... and see to it that no one else comes looking. You would do me a great disservice if you were to expose anyone to the plague that I carry.' WHERE `entry`=13072;
UPDATE `quest_template` SET `Details`='There are those of this world that tap into power unrestricted by the bounds of our mortal frames - powers of restoration, powers of life, and powers of light.  And Bridenbrad, this is no ordinary man... his valor and devotion shine through. We can only hope that one of these beings will intervene and bring this hero back from a fate worse than death.$B$BGo now and speak to Arch Druid Lilliandra in the Argent Vanguard... request passage to Moonglade and seek the aid of Keeper Remulos.' WHERE `entry`=13073;
UPDATE `quest_template` SET `Details`='The dragon-queen, Alexstrasza, possesses magics over all life. In the past, she has used great fire to incinerate undead and rebirth fresh new life in their place. Perhaps her powers might be able to save our Bridenbrad as well.$B$BAlexstrasza makes her home at Wyrmrest Temple in Dragonblight - please go to her and humbly request her aid on my behalf.' WHERE `entry`=13077;
UPDATE `quest_template` SET `Details`='In this dark time, I\'ll not be the one to abandon a champion of the Light.$B$BWe will need something sacred for this to have a hope of saving your Bridenbrad... a remnant of a devout being that fell victim to this very same plague.$B$BGo now to the sacred soil of the passages outside my Ruby Dragonshrine where the battle is joined. As my Ruby Keepers fly down and set flame to the ground beneath undead feet, you will witness new life grow forth. Among that life are Dahlia\'s Tears - bring them to me.' WHERE `entry`=13078;
UPDATE `quest_template` SET `Details`='I appreciate everything that you have done for us, $n. I have one last errand for you... one last gleaming hope for a paladin who deserves any salvation that we can extend.$B$BGo now to Shattrath and speak to the naaru, A\'dal. He has long been a beacon of light and powerful ally to devout paladins. Impart Bridenbrad\'s story and seek any aid that he might have to offer.$B$BI cannot impress how important it is that you move quickly - I fear our crusader does not have much more time in this world.' WHERE `entry`=13081;
UPDATE `quest_template` SET `Details`='I\'ve triggered the base\'s defenses, $c! Atop each of the Vanguard\'s four towers is a retractable Argent Crusade cannon, blessed by Father Gustav himself. You\'ll need to fly up to one of those towers and man a cannon. Use it to destroy the Scourge onslaught that the Lich King has deployed.$B$BJust one warning, the Scourge will undoubtedly send their frost wyrms to lay siege to the towers. Shoot them out of the sky! If they destroy the walls and towers of this base, we\'re done for!',`Objectives`='Use an Argent Cannon to destroy 100 Scourge attackers. You must also kill 3 Frostbrood Destroyers.$B$BReturn to Siegemaster Fezzik should you succeed.' WHERE `entry`=13086;
UPDATE `quest_template` SET `Details`='There have been fearsome sounds echoing from Gundrak. They have been increasing in volume and frequency of late.$b$bMy long-time student is currently recording events from her post just west of Gundrak. Perhaps you could find the time to check in on her for me?' WHERE `entry`=13099;
UPDATE `quest_template` SET `Details`='We have an important order that needs to go out!  Orton Bennet in Curiosities & Moore needs a mushroom meatloaf.$B$BGet some infused mushrooms found in the Dalaran sewers, chilled meat, and cook them in this meatloaf pan.  When you\'re done, deliver the cooked meatloaf to Orton.',`Objectives`='Use your Meatloaf Pan to cook 4 Infused Mushrooms and 2 Chilled Meats and bring the finished Mushroom Meatloaf to Orton Bennet in Curiosities & Moore, located in Runeweaver Square in Dalaran.' WHERE `entry`=13100;
UPDATE `quest_template` SET `Details`='Arille Azuregaze at the Legerdemain Lounge has a convention coming in and needs a feast pronto!$B$BYou need to provide some Northern Stew and a Jug of Wine from the cheese shop \"One More Glass\" in central Dalaran.  The owner of the cheese shop owes me the wine and you should find it somewhere around the shop.$B$BBring the wine and stews to Arille.' WHERE `entry`=13101;
UPDATE `quest_template` SET `Details`='Orton Bennet in Curiosities & Moore be needin\' a mushroom meatloaf.$B$BGet ya some infused mushrooms found in the Dalaran sewers, chilled meat, and cook \'em in the meatloaf pan.  When ye be done, bring that meatloaf to Orton.$B$BIf only de council would let me serve me gnome specialty, I would show dem a real treat!',`Objectives`='Use your Meatloaf Pan to cook 4 Infused Mushrooms and 2 Chilled Meats and bring the finished Mushroom Meatloaf to Orton Bennet in Curiosities & Moore, located in Runeweaver Square in Dalaran.' WHERE `entry`=13112;
UPDATE `quest_template` SET `Details`='Can you believe da horde has outlawed cannibalism...it just ain\'t right I tell ya!  I guess I should keep me mind on me work when we gots an order to fill.$B$BArille Azuregaze at the Legerdemain Lounge has many a guest a\'comin to his place, mon.  You gots to be providin\' some Northern Stew and a Jug of Wine from the cheese shop in central Dalaran.$B$BBring the wine and stew to Arille.',`Objectives`='Bring 4 Northern Stews and a Jug of Wine from the cheese shop in Dalaran to Arille Azuregaze at the Legerdemain Lounge found in Runeweaver Square in Dalaran.' WHERE `entry`=13113;
UPDATE `quest_template` SET `Details`='Ranid Glowergold in da Leatherworkers shop be havin\' a need for wine and cheese.  Why he don\'t want some tasty gnome is beyond me.$B$BCollect da cheese from da cheese shop in central Dalaran and da half full wine glasses found on tables around da city.  Bring da wine and serve it with the cheese to Ranid.$B$BYou can call da wine a Wine Medley, mon\'.' WHERE `entry`=13115;
UPDATE `quest_template` SET `ObjectiveText3`='Orb placed in cauldron area' WHERE `entry`=13120;
UPDATE `quest_template` SET `Details`='We must use the Lich King\'s tools against him if we are to decide our next step.$B$BOver the mountain to the southwest lies Kul\'galar Keep. Within it reside the oracles of Jotunheim who receive orders from their master and scry upon others through the Eye of the Lich King.$B$BIt is the eye that you must fight your way to. While it cannot be used to pierce the veil within Icecrown Citadel, you should be able to use it to discern something of value so that we will know how best to proceed.' WHERE `entry`=13121;
UPDATE `quest_template` SET `Details`='You pulled this jagged, dark brittle shard from the body of a ghoul. The metal blade lacks a smooth edge, suggesting it was forged by an unskilled hand, or was broken from a larger piece.$B$BYou recall seeing similar shards embedded in the bodies of all the ghouls you\'ve encountered at the Fleshwerks, leading you to wonder why their creators bothered to include the metal at all. Perhaps Crusader Olakin Sainrith would have some insight if you brought him the shards from several ghouls.' WHERE `entry`=13136;
UPDATE `quest_template` SET `Details`='<Olakin turns one of the shards over in an armored fist.>$B$BThese could pierce armor with enough force. We have to find out what they\'re made of and what the Lich King intends to do with them.$B$BTo the east, nestled next to Icecrown Citadel itself, lies Malykriss. From the few reports we have, it\'s full of smelting and smithing equipment. Bring these shards there, and smelt them in one of the open furnaces on the bottom level of Malykriss. Once the metal has been reformed, we can identify it.',`Objectives`='Use the Bag of Jagged Shards near one of the bottom level Malykriss furnaces. Return to Crusader Olakin Sainrith at Blackwatch with the Smelted Metal Bar.' WHERE `entry`=13138;
UPDATE `quest_template` SET `Details`='First things first. I saw some Lithe Stalkers on the ramparts just east of us. They used to serve us before we broke with Arthas, and they\'re about as perfect a scout as you can get... with a little prodding from an eye of dominion.$B$BFly up, find one of the stalkers, beat it down a bit, and then use this Sigil of the Ebon Blade to command its obedience. It will recognize the sigil, guaranteed. Lead it back to the top of the rocks northeast of here and it will find its way to me.',`Objectives`='Vereth the Cunning on the Rise of Suffering has requested that you bring a subdued Lithe Stalker to the top of the rocks northeast of the Rise of Suffering.' WHERE `entry`=13143;
UPDATE `quest_template` SET `Details`='We need to cause some disruption... anything to bring those death knights away from their leaders. If we lay waste to their minions below, I suspect they\'ll have to devote more attention to keeping a close eye on operations.$B$BAbominations are easy prey - slow, predictable, and most importantly, stupid. Take advantage of their trust of the stalkers to drag them some of the Scourge bombs scattered throughout the construction area. You\'ll be able light the bombs far before they figure out what\'s going on.' WHERE `entry`=13146;
UPDATE `quest_template` SET `Details`='My, it its quite chilly up here! Reminds me of the stormy peaks of Kaarinos on Argus. However, with all of this snow and ice, our soldiers can easily catch cold.$B$BHead to the Steppe of Life in southwestern Wintergrasp, and bring me back 10 of the Horde herb pouches you find. I will grind them into a medicine to help protect against the cold.$B$BThe Horde have been seen collecting them from the plant life in the area. Do not hesitate to slay them and retrieve the herbs!',`RewItemCount1`=10 WHERE `entry`=13156;
UPDATE `quest_template` SET `Details`='Sapph... Sapph\'s a death knight like no other. She\'ll shower you with sweet words and you\'ll swear that she has no evil within her heart, and then she\'ll run you through without even breaking her smile.$B$BI have no fear that you\'ll be able to best Sapph, but do not grow overconfident. Her strength lies in lulling her victims into a false ease, shortly before shattering them with a fierce barrage of frost attacks.$B$BDo not let your guard down, and do not underestimate her.' WHERE `entry`=13162;
UPDATE `quest_template` SET `Details`='Baelok is one of the few vrykul that I\'ve ever seen rise through the ranks, and that was mostly accomplished through sheer brutality. If your competition ends up dead, there\'s far less to compete against.$B$BWhen you join battle with him, spread out from your companions and keep your distance as much as you reasonably can. He will not hesitate to steal your life force for himself, so you will need to hinder his ability to do so as much as possible.$B$BYou have my confidence. See to it that he dies.' WHERE `entry`=13163;
UPDATE `quest_template` SET `Details`='With the riders of the Host of Suffering dead, now is the time to put an end to their true leader: Orbaz Bloodbane.$B$BMograine caught up with me while you were off and told me that he found where Orbaz is hiding. Under Icecrown Citadel itself, there is an immense pit - you will find Orbaz just outside its lip.$B$BSome of the Ebon Blade\'s strongest agents have already been dispatched - gather aid and join the fight. It is time for Bloodbane to die.',`Objectives`='Vereth on the Rise of Suffering has dispatched you to kill Orbaz Bloodbane.' WHERE `entry`=13164;
UPDATE `quest_template` SET `Details`='As is usual practice, the undead at the saronite quarry to the southwest starve plaguehounds to keep them extra aggressive. Use the shade to get up close and feed some of those hounds and I promise you they\'ll be content to leave you alone, if not side with the hand that fed them.$B$BDon\'t get too close to those things until you\'ve fed them though. Their noses don\'t fall victim to your shade\'s elusiveness.',`Objectives`='Keritose Bloodblade at the Shadow Vault wants you to use the Eidolon Watcher to feed 18 Hungering Plaguehounds.' WHERE `entry`=13169;
UPDATE `quest_template` SET `Details`='Ghouls are fragile things when it comes down to it, and the lookouts at the saronite quarry down the path to the southwest are no exception. Using one of the shades, I have no doubt that you can sneak up and put down their lookouts without making a sound.$B$BClear out as many lookouts as you can reach in a reasonable amount of time... we\'ll want their ranks thinned for our assault to come.' WHERE `entry`=13170;
UPDATE `quest_template` SET `Details`='My main concern is the saronite quarry down the path to the southwest. They are pulling up immense amounts of ore from that quarry and I\'d like to know what they\'re building with it. To that end, we\'ll start by weakening their defenses.$B$BI noticed a series of crystals scattered throughout the base and I assume they are defensive structures of some sort, not unlike ziggurats. Use the eidolon watcher to destroy any of those crystals that you find.' WHERE `entry`=13171;
UPDATE `quest_template` SET `Details`='Shutting down their operation is just half of the plan. The other important goal here is to find out where all that saronite is being sent. We know of a few places it\'s been ending up, but the amount they\'re pulling out suggests to me that there\'s a bigger project in the works.$B$BOnce you\'re inside the quarry, get your hands on any of their documents that you can find. If you\'re assaulting the place with one of the gryphons, you can drop down from it as soon as the wetwork is done.',`Objectives`='Keritose Bloodblade at the Shadow Vault has requested a Weeping Quarry Document, a Weeping Quarry Ledger, a Weeping Quarry Map, and a Weeping Quarry Schedule.' WHERE `entry`=13174;
UPDATE `quest_template` SET `Details`='Welcome to the Wintergrasp Fortress, $n. Your mission is simple. Defeat ten of the Horde\'s finest. Now, go! Bring victory to the Alliance!',`Objectives`='Commander Zanneth in Wintergrasp Fortress wants you to slay 10 Horde players.',`RewItemCount1`=10 WHERE `entry`=13177;
UPDATE `quest_template` SET `Details`='Welcome to the Wintergrasp Fortress, $n. Warlord Garrosh demands one thing: Slay them all!$B$BReturn to me when ten of the strongest members of the Alliance are dead.',`Objectives`='Commander Dardosh in Wintergrasp Fortress wants you to slay 10 Alliance players.',`RewItemCount1`=10 WHERE `entry`=13178;
UPDATE `quest_template` SET `Details`='Welcome to the Wintergrasp, $n. Your mission is simple. Defeat ten of the Horde\'s finest. Now, go! Bring victory to the Alliance!',`Objectives`='Commander Zanneth in Wintergrasp wants you to slay 10 Horde players.',`RewItemCount1`=10 WHERE `entry`=13179;
UPDATE `quest_template` SET `Details`='Welcome to the Wintergrasp, $n. Warlord Garrosh demands one thing: Slay them all!$B$BReturn to me when ten of the strongest members of the Alliance are dead.',`Objectives`='Commander Dardosh in Wintergrasp wants you to slay 10 Alliance players.',`RewItemCount1`=10 WHERE `entry`=13180;
UPDATE `quest_template` SET `QuestFlags`=32842,`Details`='Commander Zanneth might be satisfied with a pile of Horde corpses at his feet, but controlling Wintergrasp is of the utmost importance to the Valiance Expedition. Make sure it remains in our control.$B$BHowever, don\'t think we\'ll just let you stand around while your allies do your dirty work for you. If you\'re not at least a second level recruit by the end of the battle, don\'t come back.',`Objectives`='Win a Wintergrasp battleground match and return to Tactical Officer Abrahmis in Wintergrasp. You must have participated in the battle to be credited for the victory.',`RewItemCount1`=10 WHERE `entry`=13181;
UPDATE `quest_template` SET `QuestFlags`=32842,`Details`='While Dardosh might be content with slaying our foes, it is of the utmost importance that we control Wintergrasp Fortress. Do whatever it takes to ensure Wintergrasp is ours.$B$BHowever, don\'t think we\'ll just let you stand around while your allies do your dirty work for you. If you\'re not at least a second level recruit by the end of the battle, don\'t come back.',`Objectives`='Win a Wintergrasp battleground match and return to Tactical Officer Kilrath in Wintergrasp. You must have participated in the battle to gain credit for the victory.',`RewItemCount1`=10 WHERE `entry`=13183;
UPDATE `quest_template` SET `Objectives`='Lieutenant Murp in Wintergrasp Fortress wants you to destroy 3 Alliance siege machines.',`RewItemCount1`=10 WHERE `entry`=13185;
UPDATE `quest_template` SET `Details`='It is only a matter of time before this castle is besieged by the forces of the Horde. Destroy three of their siege devices and return to me.',`Objectives`='Senior Demolitionist Legoso in Wintergrasp Fortress wants you to destroy 3 Horde siege machines.',`RewItemCount1`=10 WHERE `entry`=13186;
UPDATE `quest_template` SET `RewItemCount1`=10 WHERE `entry`=13191;
UPDATE `quest_template` SET `RewItemCount1`=10 WHERE `entry`=13192;
UPDATE `quest_template` SET `RewItemCount1`=10 WHERE `entry`=13193;
UPDATE `quest_template` SET `Details`='Between the battles, one might almost believe that there was hope for peace in this land. Sadly, that is not to be our fate.$B$BTravel to the Steppe of Life in southwestern Wintergrasp. I have need of the roses that grow there for salve to treat the wounded.$B$BSadly, the rose has become scarce due to the Alliance harvesting it too rapidly. Slay them on the Steppe of Life and retrieve their herb pouches from the bodies.$B$BIf that fails, perhaps a lasher or two might have one.',`RewItemCount1`=10 WHERE `entry`=13194;
UPDATE `quest_template` SET `Details`='My, it is quite chilly up here! Reminds me of the stormy peaks of Kaarinos on Argus. However, with all of this snow and ice, our soldiers can easily catch cold.$B$BHead to the Steppe of Life in southwestern Wintergrasp, and bring me back 10 Horde Herb Pouches. I will grind the herbs into a medicine to protect against the cold.$B$BThe Horde have been seen collecting them from the plant life in the area. Do not hesitate to slay them and retrieve the herbs!$B$BYou may also find one on a lasher in the area.',`RewItemCount1`=10 WHERE `entry`=13195;
UPDATE `quest_template` SET `RewItemCount1`=10 WHERE `entry`=13196;
UPDATE `quest_template` SET `Details`='$n! About time you showed up. While we may have lost the last battle, we should prepare for the next! Travel to the Cauldron of Flames in southeastern Wintergrasp and retrieve several eternal embers.$B$BThe embers are mixed in with coal to fuel the Demolisher and Siege Engines. $B$BOh, and if you happen to see some of the Horde in the Cauldron, don\'t hesitate to slay them and take their embers. We must prevent them from holding the keep!',`RewItemCount1`=10 WHERE `entry`=13197;
UPDATE `quest_template` SET `RewItemCount1`=10 WHERE `entry`=13198;
UPDATE `quest_template` SET `Objectives`='Lieutenant Vieron Blazefeather in Wintergrasp wants you to retrieve 10 Quivers of Dragonbone Arrows from Alliance players at the Forest of Shadows.',`RewItemCount1`=10 WHERE `entry`=13199;
UPDATE `quest_template` SET `RewItemCount1`=10 WHERE `entry`=13200;
UPDATE `quest_template` SET `Details`='So many of our braves were lost during the battle, but even more shall die if left untreated. $B$BTravel to the Steppe of Life in southwestern Wintergrasp. I have need of the roses that grow there for salve to treat the wounded.$B$BSadly, the rose has become scarce due to the Alliance harvesting it too rapidly. Slay them on the Steppe of Life and retrieve their herb pouches from the bodies.$B$BIf that fails, perhaps a lasher or two might be in bloom.',`RewItemCount1`=10 WHERE `entry`=13201;
UPDATE `quest_template` SET `RewItemCount1`=10 WHERE `entry`=13202;
UPDATE `quest_template` SET `Objectives`='Geirrvif at Valhalas has challenged you to, in a single combat, defeat all six of the fallen heroes: Eldreth, Geness Half-Soul, Jhadras, Masud, Rith, and Talla.$B$BShould you succeed, speak with Gjonner the Merciless overlooking the southern lip of Valhalas.' WHERE `entry`=13214;
UPDATE `quest_template` SET `Details`='A variety of beings travel the world to prove themselves within Valhalas. Some even come from under the world.$B$BKhit\'rix the Dark Master is one such.$B$BHailing from deep within the ground where insanity reigns, Khit\'rix has asked for someone exotic to face in the ring. You will do.$B$BDare you face this Nerubian nightmare, $r?',`Objectives`='Geirrvif at Valhalas has challenged you to defeat Khit\'rix the Dark Master.$B$BShould you succeed, speak with Gjonner the Merciless overlooking the southern lip of Valhalas.' WHERE `entry`=13215;
UPDATE `quest_template` SET `Objectives`='Geirrvif at Valhalas has challenged you to defeat Sigrid Iceborn.$B$BShould you succeed, speak with Gjonner the Merciless overlooking the southern lip of Valhalas.' WHERE `entry`=13216;
UPDATE `quest_template` SET `Objectives`='Geirrvif at Valhalas has challenged you to defeat Carnage.$B$BShould you succeed, speak with Gjonner the Merciless overlooking the southern lip of Valhalas.' WHERE `entry`=13217;
UPDATE `quest_template` SET `Objectives`='Geirrvif at Valhalas has challenged you to defeat Thane Banahogg, the Deathblow.$B$BShould you succeed, speak with Gjonner the Merciless overlooking the southern lip of Valhalas.' WHERE `entry`=13218;
