UPDATE `quest_template` SET `Details`='Dem Alliance won\'t be long to hold that keep. Murp would smash walls, but Murp has to stay in camp. Murp wish he could smash Alliance who want to hurt Horde demolishers.$B$BYou, $n! You go in Murp\'s place. Protect 3 siege vehicles while they smash Alliance buildings. Alliance not expect you to defend demolisher. Show Alliance how smart Murp is! ',`RewItemCount1`=10 WHERE `entry`=13223;
UPDATE `quest_template` SET `Details`='We cannot defeat the Lich King on our own. Divided we shall all fall!$B$BI implore you to answer the call, $g brother:sister;. The Argent Crusade accepts all who would volunteer to aid in the war effort. Highlord Tirion Fordring himself awaits you at the Argent Vanguard! Get upon your mount and fly to the southeastern reaches of Icecrown. It is there that you will find Lord Fordring and the soldiers of the Argent Crusade.$B$BGo now, $c, for judgment day comes!' WHERE `entry`=13226;
UPDATE `quest_template` SET `Details`='They taunt us - even as they lie dying here...$b$bPlease, $g brother:miss;... Don\'t allow their mocking to be the last sounds I hear...$b$bFinish me... deliver me from this torment... into... the Light.$b$bSeek out  my companions... offer them the same mercy.$b$bLeave nothing for the Scourge to raise!$b$bI beg you...' WHERE `entry`=13232;
UPDATE `quest_template` SET `Details`='King Ymiron\'s champions stand between you and victory in the not-too-distant future.$B$BYou will travel to the fortress known as Utgarde Pinnacle nestled deep within the woods of the Howling Fjord. I cannot stress how important it is that you and your traveling companions deal with the ymirjar berserkers therein.$B$BFailure to do so may very well doom you, $N!' WHERE `entry`=13241;
UPDATE `quest_template` SET `Details`='Little is understood about the condition known as the Curse of Flesh. However, there is information to be had within the Halls of Stone.$B$BSjonnir The Ironshaper seems to know a great deal with regard to the curse. We have it on good authority that he is carrying a Titan disc of information upon him that could answer all of our questions.$B$BRetrieve this disc for me, $N, so that we may learn.' WHERE `entry`=13252;
UPDATE `quest_template` SET `Details`='While we should never miss an opportunity to strike out against the Alliance, we mustn\'t forget about the Scourge.$b$bWe won\'t have the numbers here to make a proper assault in the glacier for weeks, but that won\'t keep us from learning all we can know about their defenses.$b$bI have asked our resident death knight to advise you in this effort. After all, who better knows this enemy than they?$b$bAllow me to introduce Koltira Deathweaver.' WHERE `entry`=13260;
UPDATE `quest_template` SET `ZoneOrSort`=210 WHERE `entry`=13271;
UPDATE `quest_template` SET `Details`='Prospector Soren\'s notes say that Norgannon\'s Core is in the keeping of a sentinel named Athan, one of Mimir\'s creations.$B$BSoren says the vault where Athan resides is called \"Loken\'s Bargain\" these days.$B$BLoken, eh? The earthen have mentioned him.$B$BThe vault is said to be southwest of the ruined Explorers\' League camp, with a round entrance on a mountainside overlooking the Valley of Ancient Winters.$B$BFind this Athan and get the core from him, but I wouldn\'t be surprised if you were in for a fight.' WHERE `entry`=13274;
UPDATE `quest_template` SET `Objectives`='Koltira Deathweaver on Orgrim\'s Hammer wants you to bring him 5 Pustulant Spines from the Pustulant Horrors on Mord\'rethar.' WHERE `entry`=13277;
UPDATE `quest_template` SET `Details`='<Koltira takes the pustulant spines and drains their fluid into a flask.>$b$bA little-known quality of the flesh giants...$b$bTheir spinal fluid interacts with the plague in a very interesting way, turning it into a corrosive acid.$b$bPoured from the towering ramparts, acid may not be a welcome sight to the troops below, but at least the victims won\'t rise up and add to the enemy\'s numbers.$b$bPour the contents of this flask into one of the plague cauldrons in the western chamber of the death gate.',`Objectives`='Koltira Deathweaver aboard Orgrim\'s Hammer wants you to use Pustulant Spinal Fluid on a plague cauldron at Mord\'rethar.' WHERE `entry`=13279;
UPDATE `quest_template` SET `Objectives`='Koltira Deathweaver aboard Orgrim\'s Hammer wants you use Pustulant Spinal Fluid on a blight cauldron at Mord\'rethar.$b$bYou can create Pustulant Spinal Fluid by using a Giant Spine collected from a Pustulant Horror.' WHERE `entry`=13281;
UPDATE `quest_template` SET `Details`='Greetings $c.$B$BOur troops have been attempting to storm Ymirheim for some time, but these vrykul are far more vicious than any we\'ve faced before. They\'ve been ambushing us repeatedly as we try to make it up the pass, and we\'ve lost a lot of men.$B$BIf you want to lend yourself to the battle and help get my squad to the gates of Ymirheim safely, we will gladly reward you for your efforts. Once at the gates, we\'ll dig in and wait for reinforcements to catch up to us.',`Objectives`='Escort the Skybreaker troops to the gates of Ymirheim. Return to Ground Commander Koup at the edge of the glacier east of Ymirheim for compensation after the task is complete.' WHERE `entry`=13284;
UPDATE `quest_template` SET `Objectives`='Thassarian on the Skybreaker wants you to bring him 5 Pustulant Spines from the Pustulant Horrors on Mord\'rethar.' WHERE `entry`=13294;
UPDATE `quest_template` SET `Details`='<Thassarian takes the pustulant spines and drains their fluid into a flask.>$b$bA little-known quality of the flesh giants...$b$bTheir spinal fluid interacts with the plague in a very interesting way, turning it into a corrosive acid.$b$bPoured from the towering ramparts, acid may not be a welcome sight to the troops below, but at least the victims won\'t rise up and add to the enemy\'s numbers.$b$bPour the contents of this flask into one of the plague cauldrons in the western chamber of the death gate.',`Objectives`='Thassarian aboard the Skybreaker wants you to use Pustulant Spinal Fluid on a plague cauldron at Mord\'rethar.' WHERE `entry`=13295;
UPDATE `quest_template` SET `Details`='Greetings $c.$B$BOur troops have been attempting to storm Ymirheim for some time, but these vrykul are far more vicious than any we\'ve faced before. They\'ve been ambushing us repeatedly as we try to make it up the pass, and we\'ve lost a lot of men.$B$BIf you want to lend yourself to the battle and help get my squad to the gates of Ymirheim safely, we will gladly reward you for your efforts. Once at the gates, we\'ll dig in and wait for reinforcements to catch up to us.',`Objectives`='Escort the Kor\'kron troops to the gates of Ymirheim. Return to Ground Commander Xutjja at the edge of the glacier north of Ymirheim for compensation after the task is complete.' WHERE `entry`=13301;
UPDATE `quest_template` SET `Details`='Now that you have gathered all of the Demon cards together into a deck, another card appears on top.  It depicts a fortune teller that seems to stare at you no matter how you hold the card.$b$bYou feel the card could be used to communicate with someone or something.' WHERE `entry`=13311;
UPDATE `quest_template` SET `Details`='Corp\'rethar, called the Horror Gate. It is the last barrier between us and the Icecrown Citadel. It waits to the south of the Ironwall Rampart, beyond the glacier and the Conflagration. By the time our troops reach it, they will be exhausted and worse.$B$BWe must weaken its defenses, or our army\'s strength will break upon its walls.$B$BIts battlements are manned by some of the Lich King\'s fiercest and most zealous servants. Do all you can to destroy these guardians and hope it is enough.' WHERE `entry`=13316;
UPDATE `quest_template` SET `Details`='The Cult of the Damned hold the gate of desolation, eh? No surprise there.$b$bTime to have a little fun. At the southern end of the gate, you mentioned there were new cultists being trained. They\'re almost certain to be holding a special item given to all initiates - an Orb of Illusion.$b$bThese artifacts are used to disguise a cult member, allowing them to gain safe passage, infiltrate, or simply blend in with an enemy.$b$bKill the fools until you find one, $c, then use it on a subjugator.' WHERE `entry`=13318;
UPDATE `quest_template` SET `Details`='Looks like those initiates are increasing in number again. You know what to do...$b$bAt the southern portion of the gate, the new cultists are being trained. They\'re certain to be holding a special item given to all initiates - an Orb of Illusion.$b$bThese artifacts are used to disguise a cult member, allowing them to gain safe passage, infiltrate, or simply blend in with an enemy.$b$bSlay the fools until you find some, then use them on the subjugators there.' WHERE `entry`=13323;
UPDATE `quest_template` SET `Details`='Those vrykul that have gained the favor of the Lich King call themselves the Ymirjar. They inhabit a city in the center of Icecrown. We have a lot of preparations to make before we assault Icecrown Citadel, and the one that stands before us now is routing these so-called \"Chosen\" of the Lich King.$B$BGo to their city, Ymirheim, and slaughter them in their home. Let there be no questions as to who the stronger combatants are here.' WHERE `entry`=13336;
UPDATE `quest_template` SET `Details`='Corp\'rethar, called the Horror Gate. It is the last barrier between us and the Icecrown Citadel. It waits to the south of the Ironwall Rampart, beyond the glacier and the Conflagration. By the time our troops reach it, they will be exhausted and worse.$B$BWe must weaken its defenses, or our army\'s strength will break upon its walls.$B$BIts battlements are manned by some of the Lich King\'s fiercest and most zealous servants. Do all you can to destroy these guardians and hope it is enough.' WHERE `entry`=13338;
UPDATE `quest_template` SET `Details`='We need more men to join the main assault on Ymirheim.$B$BAny warrior with half a brain can tell you that vrykul are fierce fighters and should not be taken lightly. That goes two-fold for the Ymirjar. They have shown us no restraint in proving why the Lich King deemed them worthy.$B$BGround Commander Xutjja is overseeing the assault. The city itself is located in the center of Icecrown - Xutjja\'s troops are positioned near the edge of the glacier, north of the city.',`Objectives`='Report to Ground Commander Xutjja at the edge of the glacier north of Ymirheim.' WHERE `entry`=13340;
UPDATE `quest_template` SET `Details`='We need more men to join the main assault on Ymirheim.$B$BAny warrior with half a brain can tell you that vrykul are fierce fighters and should not be taken lightly. That goes two-fold for the Ymirjar. They have shown no restraint in proving to us why the Lich King deemed them worthy.$B$BGround Commander Koup is overseeing the assault. The city itself is located in the center of Icecrown - Koup\'s troops are positioned near the edge of the glacier, east of the city.' WHERE `entry`=13341;
UPDATE `quest_template` SET `Details`='Alright, $g friend:missy;, time to plant a bug.$b$bRelax, it\'s not a bug exactly, but it\'ll serve our purposes.$b$bIn the northern portion of Aldur\'thar the cult\'s void summoners enslave demonic minions. Use this rod to siphon the dark matter from the corpses of these enslaved minions, and then use their summoning crystal to bring our little spy into being.$b$bUntil it is discovered, the messenger will serve as our eyes and ears, discreetly observing the actions of our enemy.' WHERE `entry`=13342;
UPDATE `quest_template` SET `Details`='The cultists have discovered the last messenger you summoned, $r.$b$bWhile it was quite informative, it\'s important that we continue to monitor their every move.$b$bUse this rod to siphon the dark matter from the corpses of enslaved minions at Aldur\'thar. Then use their summoning crystal to bring another dark messenger into being.$b$bUntil it is discovered, the messenger will serve as our eyes and ears, discreetly observing the actions of our enemy.' WHERE `entry`=13344;
UPDATE `quest_template` SET `Details`='The Cult of the Damned are notorious for concocting grandiose plans that in the end, rarely succeed. But something feels different this time....$b$bPerhaps it\'s the proximity to the Lich King that has their fervor heightened. Whatever it is, they appear to be more confident than ever. We must know what feeds this bravado and then find a way to strip them of it!$b$bI believe the key lies with their researchers. Find out what they\'re up to and report back to me with the details.' WHERE `entry`=13345;
UPDATE `quest_template` SET `Details`='Do you see now?  Sending your men against the prince\'s armies just swells their numbers.$B$BI don\'t expect you to understand... you\'ll probably just end up like the others.  You\'d best return to whoever sent you.  They might be worried.' WHERE `entry`=13348;
UPDATE `quest_template` SET `Details`='We need to keep our momentum going.  Let\'s not give the Scourge forces any respite.$B$BSindragosa\'s Fall lies east just beyond the Valley of Lost Hope.  The Cult of the Damned operate there, under close supervision of the Lich King\'s undead vrykul lackeys.$B$BIt is a place of great power, possibly a blue dragonflight graveyard.  The feared frostbrood are raised there from the bones of blue dragons.$B$BAn attack there would have great impact on the enemy\'s access to frost wyrms.  Are you up to it, $N?' WHERE `entry`=13349;
UPDATE `quest_template` SET `Details`='The Cult of the Damned hold the gate of desolation, eh? No surprise there.$b$bTime to have a little fun. At the southern end of the gate, you mentioned there were new cultists being trained. They\'re almost certain to be holding a special item given to all initiates - an Orb of Illusion.$b$bThese artifacts are used to disguise a cult member, allowing them to gain safe passage, infiltrate, or simply blend in with an enemy.$b$bKill the fools until you find one, $c, then use it on a subjugator.' WHERE `entry`=13352;
UPDATE `quest_template` SET `Details`='Looks like those initiates are increasing in number again. You know what to do...$b$bAt the southern portion of the gate, the new cultists are being trained. They\'re certain to be holding a special item given to all initiates - an Orb of Illusion.$b$bThese artifacts are used to disguise a cult member, allowing them to gain safe passage, infiltrate, or simply blend in with an enemy.$b$bSlay the fools until you find some, then use them on the subjugators there.' WHERE `entry`=13353;
UPDATE `quest_template` SET `Details`='Alright, $g friend:missy;, time to plant a bug.$b$bRelax, it\'s not a bug exactly, but it\'ll serve our purposes.$b$bIn the northern portion of Aldur\'thar, the cult\'s void summoners enslave demonic minions. Use this rod to siphon the dark matter from the corpses of these enslaved minions, and then use the cultists\' summoning crystal to bring our little spy into being.$b$bUntil it is discovered, the messenger will serve as our eyes and ears, discreetly observing the actions of our enemy.' WHERE `entry`=13358;
UPDATE `quest_template` SET `Details`='There were rumors about the events you speak of among the death knights.  I always expected the story to be more... symbolic.$B$BWe must warn others, but we must be discreet.  As soon as the Lich King knows we\'re making our move, he\'ll move the location of the heart -- we\'ll never get a chance like this again.$B$BThe Horde and the Alliance have been infiltrated by the Cult of the Damned before.  The Ebon Blade operates too close to the Scourge.$B$BWe have to speak to Tirion Fordring and his Argent Crusade.' WHERE `entry`=13363;
