UPDATE `quest_template` SET `Details`='The Cult of the Damned are notorious for concocting grandiose plans that in the end, rarely succeed. But something feels different this time....$b$bPerhaps it\'s the proximity to the Lich King that has their fervor heightened. Whatever it is, they appear to be more confident than ever. We must know what feeds this bravado and then find a way to strip them of it!$b$bI believe the key lies with their researchers. Find out what they\'re up to and report back to me with the details.',`Objectives`='Koltira, aboard Orgrim\'s Hammer, wants you to collect the 3 pages of Cultists\' Research from the Cult Researchers at Aldur\'thar and use them to create the Cult of the Damned Thesis.' WHERE `entry`=13366;
