UPDATE `quest_template` SET `Details`='I installed our infra-green technology into commandeered bombers; it\'ll protect you on your first mission into enemy territory!  Speak with Rizzy Ratchwiggle to get a bomber, then fly into The Bombardment!$B$BYou\'ll have bombs and rockets and shields.  Keep the shields charged and use bombs on the ground Scourge at The Bombardment.  Come back after you hit your targets, and more work will await you.',`Objectives`='Fringe Engineer Tezzla wants you to kill 40 Bombardment Infantry, 8 Bombardment Captains and 15 Gargoyle Ambushers.' WHERE `entry`=13373;
