UPDATE `quest_template` SET `Details`='You\'re a real star, $N.  See, when I give one of these other soldiers an assignment, the odds of them getting it done are about fifty-fifty.  The odds of them coming back... well, slightly worse.$B$BBut with you, it\'s always a guaranteed thing.  Like gnomish clockwork!$B$BAnyway, I have another one for you.  Sindragosa\'s Fall, east of the valley.  There is some serious cultist activity, including and not limited to, the raising of frost wyrms.  I need you to go kick their teeth in.$B$BI hate cultists.' WHERE `entry`=13397;
